import React from 'react';
import { Link } from 'react-router-dom';

const CartPage = () => {
  return (
    <div>
      <h2>Cart</h2>
      {/* Display cart items */}
      <Link to="/checkout">Checkout</Link>
    </div>
  );
};

export default CartPage;
